import React, { useState } from 'react';
import './AutoMLPipeline.css';


const AutoMLPipeline = () => {
  const [trainFile, setTrainFile] = useState(null);
  const [trainFileLabel, setTrainFileLabel] = useState('Choose train file');
  const [predictFile, setPredictFile] = useState(null);
  const [predictFileLabel, setPredictFileLabel] = useState('Choose predict file');
  const [targetString, setTargetString] = useState('');
  const [maxRuntimeSecs, setMaxRuntimeSecs] = useState('');
  const [maxModels, setMaxModels] = useState('');
  const [nfolds, setNfolds] = useState('');
  const [seed, setSeed] = useState('');
  const [selectedAlgos, setSelectedAlgos] = useState([]);
  const [trainStatus, setTrainStatus] = useState('');
  const [predictStatus, setPredictStatus] = useState('');
  const [leaderboardData, setLeaderboardData] = useState(null);

  const handleTrainFileChange = (event) => {
    setTrainFile(event.target.files[0]);
    setTrainFileLabel(event.target.files[0].name);
  };

  const handlePredictFileChange = (event) => {
    setPredictFile(event.target.files[0]);
    setPredictFileLabel(event.target.files[0].name);
  };


  const handleTargetStringChange = (event) => {
    setTargetString(event.target.value);
  };

  const handleMaxRuntimeSecsChange = (event) => {
    setMaxRuntimeSecs(event.target.value);
  };

  const handleMaxModelsChange = (event) => {
    setMaxModels(event.target.value);
  };

  const handleNfoldsChange = (event) => {
    setNfolds(event.target.value);
  };

  const handleSeedChange = (event) => {
    setSeed(event.target.value);
  };

  const handleAlgoSelectChange = (event) => {
    const selectedOptions = Array.from(event.target.selectedOptions).map((option) => option.value);
    setSelectedAlgos(selectedOptions);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    const formData = new FormData();
    formData.append("file", trainFile);
    formData.append("target_string", targetString);
    formData.append("max_runtime_secs", maxRuntimeSecs);
    formData.append("max_models", maxModels);
    formData.append("nfolds", nfolds);
    formData.append("seed", seed);
    formData.append("include_algos", JSON.stringify(selectedAlgos));

    const response = await fetch("http://localhost:8000/train", {
      method: "POST",
      body: formData,
    });

    const data = await response.json();
    setLeaderboardData(data);
  };

  // Other functions for handling the form submission and API calls will go here.

  return (
    <div className="AutoMLApp">


<h2>AutoML Pipeline</h2>

<div>
    <h3>Upload Train File</h3>
    <input type="file" id="trainFile" onchange={handleTrainFileChange}/>
    <label id="trainFileLabel">Choose file...</label>
    <br/>

    <input type="text" id="target_string" placeholder="Enter Target Column(*)"/>
    <br/>
    <input type="number" id="max_runtime_secs" placeholder="Max Runtime" min="0"/>
    <br/>
    <input type="number" id="max_models" placeholder="Max Models" min="1"/>
    <br/>
    <input type="number" id="nfolds" placeholder="Number of Folds" min="2"/>
    <br/>
    <input type="number" id="seed" placeholder="Random Seed"/>
    <br/>
    <select id="algo-select" multiple>
        <option value="GLM">GLM</option>
        <option value="DRF">DRF</option>
        <option value="GBM">GBM</option>
        <option value="DeepLearning">DeepLearning</option>
        <option value="XGBoost">XGBoost</option>
        <option value="StackedEnsemble">StackedEnsemble</option>
      </select>
    <button onclick="uploadTrainFile()">Upload Train File</button>
    <br/>
    <div id="trainStatus"></div>
</div>
<pre id="jsonLeaderboard"></pre>
<div>
    <h3>Upload Predict File</h3>
    <input type="file" id="predictFile" onchange={handlePredictFileChange}/>
    <label id="predictFileLabel">Choose file...</label>
    <br/>
    <button onclick="uploadPredictFile()">Upload Predict File</button>
    <div id="predictStatus"></div>
</div>






    </div>
  );
};


export default AutoMLPipeline;
